// src/components/Navbar.js
import React from 'react';

const Navbar = ({ onCallForHelp }) => {
  return (
    <div style={{ width: '200px', height: '100vh', backgroundColor: '#f4f4f4', padding: '10px' }}>
      <h2>Disaster Response</h2>
      <button
        style={{ padding: '10px', marginTop: '20px', width: '100%' }}
        onClick={onCallForHelp}
      >
        Call for Help
      </button>
    </div>
  );
};

export default Navbar;
